    func sChartData(xAchse:[String]) {
        var yWerte:[ChartDataEntry] = [ChartDataEntry]()
        for i in 0 ..< yAchse.count {
            yWerte.append(ChartDataEntry(x: Double(i), y: yAchse[i]))
        }
        
        let set:LineChartDataSet = LineChartDataSet(values: yWerte, label: "Wurf1")
        
        set.axisDependency = .Left // Line will correlate with left axis values
//        set.setColor(UIColor.redColor().colorWithAlphaComponent(0.5)) // our line's opacity is 50%
//        set.setCircleColor(UIColor.redColor()) // our circle will be dark red
//        set.lineWidth = 2.0
//        set.circleRadius = 6.0 // the radius of the node circle
//        set.fillAlpha = 65 / 255.0
//        set.fillColor = UIColor.redColor()
//        set.highlightColor = UIColor.whiteColor()
//        set.drawCircleHoleEnabled = true
        
        set.mode = .CubicBezier
        set.drawCirclesEnabled = false
        
        set.drawCubicEnabled = true
        
        //set.fillAlpha = 65;
        
        let data:LineChartData = LineChartData(dataSet: set)
        
        self.lineChartView.data = data
        
    }

